import { Link } from "react-router-dom";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbarboot from "react-bootstrap/Navbar";

const Navbar = () => {
  return (
    <header>
      <div className="navbar animate__animated animate__fadeInLeft animate__slower">
        <Link to="/">
          <h2>Workout Buddy</h2>
        </Link>
        <div classNameName="right-nav">
          <ul>
            <li className="sign">Sign in</li>
            <li className="sign">Sign up</li>
          </ul>
          <p></p>
          <p className="sign"></p>
        </div>
      </div>

      <Navbarboot bg="light" variant="light">
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbarboot>
    </header>
  );
};

export default Navbar;
